import React from "react";
import Header from "../components/Header";
import Content from "../components/Content";
import Footer from "../components/Footer";

const Homepage = ({ translateData, lang }) => {
  const { buttons, placeholders, results, scrolls, sizes } = translateData;
  const { how_to_use } = translateData;

  return (
    <div className='bg-hero flex-row min-h-screen '>
      <div className='flex justify-center'>
        {/* Cabe√ßalho */}
        <Header lang={lang} />
        {/* Calculador */}
        <div className='p-10 bg-red-500'>
          <Content
            buttons={buttons}
            placeholders={placeholders}
            results={results}
            scrolls={scrolls}
            sizes={sizes}
            lang={lang}
          />
        </div>
        {/* Info */}
        <Footer how_to_use={how_to_use} />
      </div>
    </div>
  );
};

export default Homepage;
